import React from 'react';
import Header from './Header';
import './css/Home.css';
const Home = () => {
    return (
        <div>
            <Header />
            <main>
                <video autoPlay muted loop>
                    <source src="path/to/your/video.mp4" type="video/mp4" />
                    {/* Thêm các nguồn video khác nếu cần */}
                </video>
            </main>
        </div>
    );
};

export default Home;
